Принято считать, что внутри клетки заряд отрицательный, а снаружи - положительный. И разность между ними называется потенциалом покоя и равна -70 мв ([заряд снаружи] - [заряд внутри]). За счет чего так происходит? Здесь играет 2 фактора:  
1) работа натрий-калиевого насоса поддерживает постоянную разность в -10 мв;  
2) потеря положительных катионов калия в процессе работы каналов приводит к отрицательному заряду клетки в состоянии покоя.

Синапсы - это контакты клеток, и они бывают очень разные. На высветившейся таблице ты можешь увидеть их классификацию. Важно понять, что нейроны могут проводить сигнал  
1) на нейроны, мышечные и секреторные клетки;   
2) на нейроны разными способами - с аксона на дендрит, с аксона на тело, с аксона на аксон и т.д.;   
3) могут проводить, как и по нейрону, электрическим путем, а могут - химическим.
